    public function downloadWhatsappMedia($mediaId, $type)
    {
        $mimeToExtension = [
            'image/jpeg' => 'jpg',
            'image/png' => 'png',
            'image/gif' => 'gif',
            'image/bmp' => 'bmp',
            'image/webp' => 'webp',
            'video/mp4' => 'mp4',
            'audio/mpeg' => 'mp3',
            'audio/ogg' => 'ogg',
            'application/pdf' => 'pdf',
            // Add more mappings as needed
        ];
        // Fetch media URL
        $url = 'https://graph.facebook.com/v17.0/' . $mediaId; // Replace with your API version
        $ch = curl_init($url);
        curl_setopt($ch, CURLOPT_HTTPHEADER, ['Authorization: Bearer ' . getenv('WB_TOKEN_2')]);
        curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
        $response = curl_exec($ch);
        curl_close($ch);
        $mediaData = json_decode($response, true);
        $downloadUrl = $mediaData['url'];
        log_message('error',  "Failed to c image from string: " . $downloadUrl);
        $client = \Config\Services::curlrequest();

        $url = $downloadUrl;
        $accessToken = getenv('WB_TOKEN_2');
        $userAgent = 'Mozilla/5.0 (compatible; Googlebot/2.1; +http://www.google.com/bot.html';
        // Send the GET request
        $response = $client->request('GET', $url, [
            'headers' => [
                'Authorization' => 'Bearer ' . $accessToken,
                'User-Agent' => $userAgent,
            ]
        ]);
        $mimeType = $mediaData['mime_type'];
        $extension = isset($mimeToExtension[$mimeType]) ? $mimeToExtension[$mimeType] : $mimeType;
        // $filePath = WRITEPATH . 'uploads/whatsapp/media/' . $mediaId . '.' . $extension;
        // file_put_contents($filePath,  $response->getBody());


        $awss3 = new \Aws\S3\S3Client(
            [
                'version' => 'latest',
                'region'  => 'me-central-1',
                'credentials' => [
                    'key'    => getenv('S3_BUCKET_KEY'),
                    'secret' => getenv('S3_BUCKET_SECRET')
                ],
                'suppress_php_deprecation_warning' => true,
            ]
        );
        try {
            if ($type == 5) {
                $folder = 'images';
            } else if ($type == 1) {
                $folder = 'audio';
            } else if ($type == 11) {
                $folder = 'video';
            } else if ($type == 8) {
                $folder = 'sticker';
            } else if ($type == 3) {
                $folder = 'documents';
            } else {
                $folder = 'general';
            }
            $result = $awss3->putObject([
                'Bucket' => 'autoversa-media',
                'Key'    => 'crm_whatsapp_media/' . date('Y_m_d') . '/' . $folder . '/' . $mediaId . '.' . $extension,
                'Body'   => $response->getBody(),
                'ACL'    => 'public-read',
                'ContentType' => $extension, // make file 'public'
            ]);
        } catch (\Aws\S3\Exception\S3Exception $e) {
            //$msg = 'File has been uploaded';
            echo $e->getMessage();
            return $e->getMessage();
        }
        return 'crm_whatsapp_media/' . date('Y_m_d') . '/' . $folder . '/' . $mediaId . '.' . $extension;
    }

    public function uploadImageToAws($file, $filename, $filetype)
    {
        $awss3 = new \Aws\S3\S3Client(
            [
                'version' => 'latest',
                'region'  => 'me-central-1',
                'credentials' => [
                    'key'    => getenv('S3_BUCKET_KEY'),
                    'secret' => getenv('S3_BUCKET_SECRET')
                ],
                'suppress_php_deprecation_warning' => true,
            ]
        );
        try {

            $result = $awss3->putObject([
                'Bucket' => 'autoversa-media',
                'Key'    => 'crm_whatsapp_media/sent/' . date('Y_m_d') . '/' . $filename,
                'SourceFile'   => $file,
                'ACL'    => 'public-read',
                'ContentType' => $filetype // make file 'public'
            ]);

            return 'crm_whatsapp_media/sent/' . date('Y_m_d') . '/' . $filename;
        } catch (\Aws\S3\Exception\S3Exception $e) {
            //$msg = 'File has been uploaded';
            echo $e->getMessage();
            return $e->getMessage();
        }
    }



